import React from "react";
import { Grid, Typography, FormLabel, Input } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(theme => ({
  root: {
    borderSizing: "border-box",
    background: "#94bde7",
    color: "485e74",
    lineHeight: "1.6",
    fontFamily: "Segoe UI, Tahoma, Geneva, Verdana, sans-serif",
    padding: "1em"
  },
  body: {
    maxWidth: "1170px",
    marginLeft: "auto",
    marginRight: "auto",
    padding: "1em"
  },
  item: {
    padding: "1em"
  },

  title: {
    textAlign: "center"
  },
  ul: {
    listStyle: "none",
    padding: "0"
  },
  company: {
    background: "#c9e6ff"
  },
  typography: {
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif"
  }
}));
export default function TravMedia() {
  const classes = useStyles();
  return (
    <>
      <div className={classes.root}>
        <Grid
          className={classes.body}
          container
          direction="column"
          justifyContent="center"
          alignItems="center"
        >
          <Grid item lg={12}>
            <Typography className={classes.title} variant="h4">
              <span style={{ color: "white", fontWeight: "bold" }}> Axel</span>{" "}
              Front End
            </Typography>
          </Grid>
          <Typography className={classes.ul} variant="body1" component="ul">
            <Typography className={classes.li} variant="body1" component="li">
              44 something street
            </Typography>
            <Typography className={classes.li} variant="body1" component="li">
              666 666 666
            </Typography>
            <Typography className={classes.li} variant="body1" component="li">
              test@test.se
            </Typography>
          </Typography>
        </Grid>{" "}
        <Grid item className={classes.wrapper}>
          <Typography className={classes.item} variant="h5">
            Email us:
          </Typography>
          <form>
            <Typography className={classes.item}>
              <FormLabel>Name:</FormLabel>
              <Input name="name" type="text"></Input>
            </Typography>
            <Typography className={classes.item}>
              <FormLabel>Company:</FormLabel>
              <Input name="name" type="text"></Input>
            </Typography>
            <Typography className={classes.item}>
              <FormLabel>Email:</FormLabel>
              <Input name="EmailAdress" type="email"></Input>
            </Typography>
            <Typography className={classes.item}>
              <FormLabel>PhoneNumber:</FormLabel>
              <Input name="Phone" type="text"></Input>
            </Typography>
            <Typography className={classes.item}>
              <FormLabel>Message:</FormLabel>
              <textArea name="message" rows="5"></textArea>
            </Typography>
          </form>
        </Grid>
      </div>
    </>
  );
}
